script: |
  super -f text -I q11111.spq | sort > q11111.out

inputs:
  - name: q11111.spq
    data: |
      SELECT CAST ( NULL AS INTEGER ) AS col0 FROM tab0 (FORMAT parquet) WHERE ( NOT col2 * - - col1 + - + ( col0 ) >= CAST ( + - col0 AS INTEGER ) );
  - name: tab0

outputs:
  - name: q11111.out
    data: |
